import React from "react";
import { NavLink } from "react-router-dom";
import { AppBar, Button, Toolbar } from "@mui/material";

export default function Main(){
    const activeStyle = { backgroundColor:"deepskyblue", color:"black"};
    return(
        <AppBar position="sticky">
            <Toolbar >
                <Button component={NavLink} to='/product' activeStyle={activeStyle}>Product</Button>
                <Button component={NavLink} to='/employee' activeStyle={activeStyle}>Employee</Button>
            </Toolbar>
        </AppBar>
    )
}
